script:
let colorByJpath = API.getData('colorByJpath').resurrect()
let wellsList = API.getData('wellsList');
if (!wellsList || !colorByJpath) return;
let colnumber = colorByJpath.colnumber;
let rownumber = colorByJpath.rownumber;
let direction = colorByJpath.direction;
let shape = colorByJpath.shape;
let wellSize = colorByJpath.wellSize;

let setup = {
  plateIndex: 0,
  colorOptions: undefined,
  wellSize: wellSize,
  colnumber: colnumber,
  rownumber: rownumber,
  direction: direction,
  colorjpath: undefined,
  shape: shape,
  spectrumColors: [0, 0, 0, 1],
  jpathValue: "element.experiment.concentration.value",
  max: 10,
  min: 0,
}

API.createData('setup', setup)

let parameter;
if (!this.action) return;
console.log(this.action.name)
switch (this.action.name) {
  case "colorByStrain": {
    parameter = 'strain'
    break;
  }
  case "colorByConcentration": {
    parameter = 'concentration'
    break;
  }
  case "colorByExtract": {
    parameter = 'extracts'
    break;
  }
  case "removeColors": {
    parameter = false
    break;
  }
}

let setup = {
    color: true,
    colorOptions: parameter ? "colorByJpath" : undefined,
    colorjPath: parameter ? `element.experiment.${parameter}.value` : undefined,
}

API.createData('setup', setup)

let colorByJpathValue = API.getData('colorByJpathValue').resurrect();
let wellsList = API.getData('wellsList');
if (!wellsList || !colorByJpathValue) return;
let min=colorByJpathValue.min;
let max=colorByJpathValue.max;
let display=colorByJpathValue.display;
let setup;
if (display) {
    setup = {
        color: true,
        colorOptions: "colorByJpathValue",
        colorjPath: undefined,
        jpathValue: "element.experiment.concentration.value",
        max: max,
        min: min,
    }
} else {
    setup = {
        color: true,
        colorOptions: undefined,
        colorjPath: undefined,
    }
}

API.createData('setup', setup);
